import React from 'react';
function User(props) {

    return ( 
        <div style={{display:'flex', alignItems:'center', gap:'15px'}}>
            <p style={{fontSize:'1.5rem', fontWeight:'bold'}}>{props.nameuser}</p>
            <button>Modifier</button> 
            <button>Supprimer</button>
        </div>
        
     );
}

export default User;
